import { Component } from '@angular/core';

@Component({
  selector: 'app-poderes-create',
  templateUrl: './poderes-create.component.html',
  styleUrls: ['./poderes-create.component.css']
})
export class PoderesCreateComponent {
  herois: mdlHerois = {
    id: 0,
    dataNascimento: new Date(),
    nome: "",
    nomeHeroi: "",
    altura: 0,
    peso: 0,
  };

  constructor(private ApiService: ApiService, private router: Router) {

  }

  criar(): void {
    this.ApiService.postHerois(this.herois).subscribe(() => {
        this.router.navigate(['/herois'])
    })
  }

  Voltar(): void {
    this.router.navigate(['/herois'])
  }
}
